LEN_WAV_PAS = len(WAV_PAS)

class Intro_crunch:
    def __init__(self, IpulseHz):
        self.wavPas = DataTable(size=LEN_WAV_PAS, init=WAV_PAS)
        self.envPulse = LinTable([(0,1), (8191,1)])
        self.pas = Pulsar(table=self.wavPas, env=self.envPulse, freq=IpulseHz, 
                          frac=[IpulseHz*0.5,IpulseHz*0.48], interp=4, mul=1.25).stop()
        self.rezons = Waveguide(self.pas, freq=[32.7032, 65.4064, 98.1, 81.758], 
                                dur=30, mul=.1).stop()
        self.rezfilt = Tone(self.rezons, freq=1500).stop()
        self.rev = WGVerb(self.pas, feedback=.99, cutoff=10000, bal=.25, 
                          mul=.75).stop()

    def play(self):
        self.pas.play()
        self.rezons.play()
        self.rezfilt.out()
        self.rev.out()

    def tail(self):
        self.pas.stop()

    def stop(self):        
        self.pas.stop()
        self.rezons.stop()
        self.rezfilt.stop()
        self.rev.stop()

    def interp(self, x):
        self.pas.interp = x

class Intro_buzz:
    def __init__(self):
        self.wav = HarmTable([.1,0,.2,0,.1,0,0,0,.04,0,0,0,0.02])
        self.env = HannTable()

        fadetime = 60
        self.base_pits =    [midiToHz(48),midiToHz(48)*0.997,midiToHz(60),midiToHz(60)*1.007,
                            midiToHz(67),midiToHz(67)*1.008,midiToHz(36),midiToHz(36)*0.993,
                            midiToHz(24),midiToHz(24)*0.99]
        self.pit_rnds = Randi(0.994, 1.006, [random.uniform(3,6) for i in range(10)], 
                              mul=self.base_pits).stop()
        self.pitches = Port(self.pit_rnds, .1, .1, init=self.base_pits).stop()
        self.frac = Sine(freq=[.05,.04], mul=.2, add=.7).stop()

        self.lfo1 = Sine([.1,.12,.15,.13,.14,.16], 0, .35, .65).stop()
        self.fade1 = Fader(fadein=4, fadeout=fadetime, mul=self.lfo1)
        self.buzz1 = Pulsar(table=self.wav, env=self.env, freq=self.pitches[:6], 
                       frac=self.frac, mul=[.05,.05,.04,.04,.007,.007]*self.fade1).stop()
        self.mix1 = Mix(self.buzz1, 2).stop()

        self.fade2 = Fader(fadein=4, fadeout=fadetime)
        self.buzz2 = Pulsar(table=self.wav, env=self.env, freq=self.pitches[6:8], 
                            frac=self.frac, mul=.09*self.fade2).stop()

        self.fade3 = Fader(fadein=4, fadeout=fadetime)
        self.buzz3 = Pulsar(table=self.wav, env=self.env, freq=self.pitches[8:10], 
                            frac=self.frac, mul=.15*self.fade3).stop()

        self.rev = Freeverb(self.mix1+self.buzz2+self.buzz3, size=1.0, 
                            damp=.25, bal=.75).stop()

    def play1(self):
        self.pit_rnds.play()
        self.pitches.play()
        self.frac.play()
        self.lfo1.play()
        self.fade1.play()
        self.buzz1.play()
        self.mix1.play()
        self.rev.out()

    def play2(self):
        self.fade2.play()
        self.buzz2.play()

    def play3(self):
        self.fade3.play()
        self.buzz3.play()  

    def tail(self):
        self.fade1.stop()
        self.fade2.stop()
        self.fade3.stop()

    def stop(self):
        self.pit_rnds.stop()
        self.pitches.stop()
        self.frac.stop()
        self.lfo1.stop()
        self.buzz1.stop()
        self.mix1.stop()
        self.buzz2.stop()
        self.buzz3.stop()
        self.rev.stop()

    def interp(self, x):
        self.buzz1.interp = x
        self.buzz2.interp = x
        self.buzz3.interp = x

class Intro_high_sines:
    def __init__(self):
        self.wav = HarmTable([.1,0,.2,0,.1,0,0,0,.04,0,0,0,0.02])
        self.fade = Fader(3, 20, mul=.005)
        self.mod = Osc(self.wav, [.3,.5,.4]).stop()
        self.car = Sine([4010,4050,4000], mul=self.mod).stop()
        self.pan = SPan(self.car, pan=[0,.5,1], mul=self.fade).stop()

    def play(self):
        self.fade.play()
        self.mod.play()
        self.car.play()
        self.pan.out()

    def tail(self):
        self.fade.stop()

    def stop(self):
        self.mod.stop()
        self.car.stop()
        self.pan.stop()


class Intro_low_sines:
    def __init__(self, count, IpulseSec):
        self.env = LinTable([(0,0), (1000,0), (3000,.7), (4500,.3), (6000,.7), (8191,0)])
        self.sel = Select(count, [3,4,5,6,7,8,9,10]).stop()
        self.selmixed = self.sel.mix()
        self.fade = TrigEnv(self.selmixed, self.env, IpulseSec, mul=.03).stop()
        self.freq = TrigChoice(self.selmixed, list(range(32, 250, 33)), mul=[1,1]).stop()
        self.sine = Sine(freq=self.freq, mul=self.fade).stop()

    def play(self):
        self.sel.play()
        self.fade.play()
        self.freq.play()
        self.sine.out()

    def stop(self):
        self.sel.stop()
        self.fade.stop()
        self.freq.stop()
        self.sine.stop()

class Rhythm_lfo_tables:
    def __init__(self, lfo_freq=[.025, .05]):
        self.table1 = CurveTable([(0,0), (2048,.7), (4096, 0.1), (6144,.5), (8192,0)], tension=0, bias=20).normalize()
        self.table2 = CurveTable([(0,0), (2048,.7), (4096, 0.1), (6144,.5), (8192,0)], tension=0, bias=20).normalize()
        #  LFOS from 0 to 40
        self.lfo1 = Sine(lfo_freq[0], 0, 20, 20).stop()
        self.lfo2 = Sine(lfo_freq[1], 0, 20, 20).stop()
        self.pat1 = Pattern(self.change1, .143).stop()
        self.pat2 = Pattern(self.change2, .125).stop()

        self.metro = Metro(4).play()

    def getTables(self):
        return [self.table1, self.table2]

    def getMetro(self):
        return self.metro

    def change1(self):
        val = self.lfo1.get()
        self.table1.setBias(val)
        self.table1.normalize()
        
    def change2(self):
        val = self.lfo2.get()
        self.table2.setBias(val)
        self.table2.normalize()

    def play(self):
        self.lfo1.play()
        self.pat1.play()
        self.lfo2.play()
        self.pat2.play()
    
    def stop(self):
        self.lfo1.stop()
        self.pat1.stop()
        self.lfo2.stop()
        self.pat2.stop()

class Rhythm_pulses:
    def __init__(self, tables, env_freq=2, amp=.7, choice=[48, 50, 55, 57], metro=None):
        self.choice = choice
        self.index = 1
        freq = self.choice[self.index]
        self.freq = SigTo(midiToHz(freq), time=0.005, init=midiToHz(freq))
        self.freq2 = Sig(self.freq, mul=0.9932)
        self.amp = SigTo(amp, time=40, init=amp)
        self.rhythm_pulse = Rhythm_pulse(table=tables[0], freq=self.freq, lfo_freq=.025, env_freq=env_freq, amp=self.amp)
        self.rhythm_pulse2 = Rhythm_pulse(table=tables[1], freq=self.freq2, lfo_freq=.05, env_freq=env_freq*1.0003, amp=self.amp)

        self.pct = Percent(metro, 25).stop()
        self.trig = TrigFunc(self.pct, self.changePitch).stop()
        
    def changePitch(self):
        step = random.choice([-2, -1, 1, 2])
        self.index += step
        if self.index < 0:
            self.index = abs(self.index)
        elif self.index >= len(self.choice):
            self.index = len(self.choice) - random.choice([1, 2])
        self.freq.value = midiToHz(self.choice[self.index])

    def getOut(self):
        return self.rhythm_pulse.getOut()+self.rhythm_pulse2.getOut()

    def startPitchChanges(self):
        self.pct.play()
        self.trig.play()

    def stopPitchChanges(self):
        self.pct.stop()
        self.trig.stop()

    def play(self):
        self.rhythm_pulse.play()
        self.rhythm_pulse2.play()

    def tail(self):
        self.rhythm_pulse.tail()
        self.rhythm_pulse2.tail()

    def stop(self):
        self.rhythm_pulse.stop()
        self.rhythm_pulse2.stop()

class Rhythm_pulse:
    def __init__(self, table, freq=100, lfo_freq=.1, env_freq=2, amp=1):
        #self.wav = HarmTable([.4,0,.2,0,.1,0,0.1,0,.04,0,0,0,0.02,0,0,.018,0,0,0,.015])
        self.wav = HarmTable([1,0,.1,0,.1,0,0,0,.04])
        self.env = HannTable()
        self.osc = Osc(table=table, freq=env_freq, mul=.1)

        frac_freqs = [random.uniform(.01,.06),random.uniform(.01,.06)]
        self.frac = Sine(freq=frac_freqs, mul=.2, add=.65)
        self.fade = Fader(fadein=20, fadeout=.5, mul=amp)
        self.buzz = Pulsar(table=self.wav, env=self.env, freq=[freq*random.uniform(.99,1.01) for i in range(4)], 
                            frac=self.frac, mul=self.osc*self.fade).stop()
        self.mix = self.buzz.mix(2)                    

    def getOut(self):
        return self.mix

    def play(self):
        self.fade.play()
        self.buzz.play()

    def tail(self):
        self.fade.stop()

    def stop(self):
        self.buzz.stop()

class Rhythm_high_sines:
    def __init__(self):
        self.globenv = CosTable([(0,0),(100,1),(4000,1),(8191,0)])

        self.fader = Fader(fadein=0.001, fadeout=40)
        self.pct = Linseg([(0,10),(60,10),(90,30),(160,100)])
        self.met = Metro(1, 8)
        self.comp = Percent(self.met, self.pct).stop()
        self.fade = TrigEnv(self.comp, self.globenv, dur=7.8, mul=.003).stop()
        self.freq = TrigRand(self.comp, min=3000, max=8000).stop()
        self.lfo_freq = TrigChoice(self.comp, [8,10,12,14,16]).stop()
        self.panpos = TrigRand(self.comp).stop()
        self.freqrnd = Randi(.996, 1.004, 3).stop()
        self.lfo = Sine(self.lfo_freq, mul=.5, add=.5).stop()
        self.sine = Sine(freq=self.freq*self.freqrnd, 
                        mul=self.fade*self.lfo).stop()
        self.pan = SPan(self.sine, pan=self.panpos).stop()
        self.denorm = Denorm(self.pan.mix(2), mul=self.fader).stop()

    def getOut(self):
        return self.denorm

    def play(self):
        self.fader.play()
        self.pct.play()
        self.met.play()
        self.comp.play()
        self.fade.play()
        self.freq.play()
        self.lfo_freq.play()
        self.panpos.play()
        self.freqrnd.play()                  
        self.lfo.play()
        self.sine.play()
        self.pan.play()
        self.denorm.play()

    def tail(self):
        print("rhythm_high_sines tail...")
        self.fader.stop()

    def stop(self):
        self.pct.stop()
        self.met.stop()
        self.comp.stop()
        self.fade.stop()
        self.freq.stop()
        self.lfo_freq.stop()
        self.panpos.stop()
        self.freqrnd.stop()                  
        self.lfo.stop()
        self.sine.stop()
        self.pan.stop()
        self.denorm.stop()

class Rhythm_verb:
    def __init__(self, input):
        self.input = input
        self.verb = WGVerb(Denorm(self.input), feedback=.75, cutoff=7000, bal=.25).stop()  

    def play(self):
        self.verb.out()

    def stop(self):
        self.verb.stop()

class Rhythm_bass:
    def __init__(self, freq=65.4, mul=.1):
        self.fade = Fader(fadein=20, fadeout=40)
        self.fade2 = Pow(self.fade, 5, mul=mul).stop()
        self.bnoise = BrownNoise([self.fade2,self.fade2]).stop()
        self.lp = Biquadx(self.bnoise, freq=freq, q=2, stages=2).stop()

    def play(self):
        self.fade.play()
        self.fade2.play()
        self.bnoise.play()
        self.lp.out()

    def tail(self):
        self.fade.stop()

    def stop(self):
        self.fade2.stop()
        self.bnoise.stop()
        self.lp.stop()

